//"releaseNotes":"• С помощью нового редактора фотографий профиля и групп вы можете загрузить изображение, просто написать несколько букв или выбрать одну из наших новых фотографий по умолчанию.\n\nВам интересно помогать улучшать Signal? Мы нанимаем на работу. Посетите https://signal.org/workworkwork, чтобы узнать больше.", "primaryGenreId":6005, "currency":"RUB", "version":"5.17", "wrapperType":"software", "artistId":874139672, "artistName":"Signal Messenger, LLC", "genres":["Социальные сети", "Утилиты"], "price":0.00,
//"description":"Миллионы людей используют Signal каждый день, чтобы бесплатно и моментально обмениваться сообщениями в любой точке мира. Отправляйте и получайте сообщения, участвуйте в голосовых и видеозвонках высокого качества и изучайте всё новые и новые функции, которые помогают вам оставаться на связи. Передовая технология обеспечения конфиденциальности Signal всегда включена, поэтому вы можете сосредоточиться на том, чтобы делиться важными моментами с людьми, которые важны для вас.\n\n• Говорите что угодно — новейшая технология сквозного шифрования (основанная на протоколе Signal Protocol™ с открытым исходным кодом) надёжно защищает ваши разговоры. Приватность здесь не дополнительная функция — Signal просто так работает. При каждом сообщении, при каждом звонке, каждый раз.\n\n• Ощутите скорость — сообщения доставляются быстро и бесперебойно даже при медленном соединении. Signal разработан так, чтобы отлично работать даже в самых сложных условиях.\n\n• Почувствуйте свободу — Signal является полностью независимым некоммерческим продуктом. Разработка поддерживается нашими пользователями. Без рекламы. Без отслеживания. Без обмана.\n\n• Будьте собой — вы можете использовать свой действующий номер телефона и адресную книгу для защищённого общения с друзьями.\n\n• Говорите и слушайте — живут ли ваши друзья и родственники за городом или за океаном, благодаря улучшенному качеству звука и видео в Signal вы почувствуете себя рядом.\n\n• Шепчитесь в тени — переключитесь на тёмную тему, если вас не привлекает светлая сторона.\n\n• Найдите свой звук — выберите разные звуки уведомлений для каждого контакта или полностью отключите их. Если предпочитаете звуки тишины, просто выберите \"Без звука\" в качестве мелодии звонка.\n\n• Творите — используйте встроенные функции редактирования изображений, чтобы рисовать, обрезать и вращать фотографии перед отправкой. Хотя фотография стоит тысячи слов, вы сможете добавить ещё несколько при помощи инструмента \"Текст\".\n\n\nЗа поддержкой или дополнительной информацией обращайтесь на сайт: \nhttps://support.signal.org\n\nИсходный код:\nhttps://github.com/signalapp\n\nПодпишитесь на нас в Twitter (@signalapp) и Instagram (@signal_app), чтобы быть в курсе последних обновлений и анонсов.", "bundleId":"org.whispersystems.signal", "userRatingCount":58462},
