//"description":"*Поддерживаемые устройства: iPhone 8, iPad 5 (2017), iPad Air 2 и более свежие версии. Не работает на iPod Touches.*\n\nДобро пожаловать в Hello Guest! Это игра в жанре триллер с элементами стелс-хоррора про самообучающийся ИИ. По ночам вы работаете в парке развлечений «Золотое яблоко», где во тьме скрывается таинственное существо.\n\nСущество обладает искусственным интеллектом, следит за вами и учится вашим движениям. Оно боится света и всегда подкрадывается со спины. Берегитесь!", "bundleId":"com.tinybuildgames.helloguest", "userRatingCount":719},
