//"releaseNotes":"Что нового:\n- Встречайте новые скины дома соседа! Теперь вы можете изменить дом соседа вместе с окружением! Попробуйте уже прямо сейчас летний скин дома. \n- Сегодня сосед переодевается в пирата! Мы добавили пиратский набор скинов соседа.\n- Исправлено тонну ошибок", "primaryGenreId":6014, "currency":"RUB", "version":"6.3.0", "wrapperType":"software", "artistId":1385421493, "artistName":"PAGA GROUP LTD", "genres":["Игры", "Головоломки", "Развлечения", "Приключения"], "price":0.00,
//"description":"Соседи порой могут создавать проблемы посерьезнее, чем шум в неположенное время суток. \n\nВ этой игре вам предстоит столкнуться именно с таким необычным соседом, жилище которого таит в себе леденящие кровь тайны. Проберитесь в его дом незамеченным, минуя все ловушки и видеокамеры, и докопайтесь до истины! \n\n\u2028\u2028\u2028Главным героем в этом интерактивном триллере являетесь вы сами благодаря реалистичной камере от первого лица.\n\nПереехав в новый дом, вы обнаруживаете некоторые странности в поведении вашего нелюдимого соседа из дома напротив. Он никогда не покидает свое жилище, из которого регулярно доносятся какие-то странные звуки, похожие на крики. А одной темной ночью сосед выволакивает из своего дома мешок с чем-то, жутко напоминающим человеческое тело. Становится ясно – происходит что-то страшное. Оставаться в стороне нельзя – нужно проникнуть в дом соседа и разведать, что же там творится! Однако сделать это будет не так-то легко! Каждый угол его двора украшает подвижная видеокамера, а все двери и окна надежно заперты. Да и сам сосед является довольно опасным человеком, который не остановится ни перед чем, лишь бы скрыть все свои темные дела. Если он обнаружит вас, вы вряд ли сумеете покинуть его дом живым! Оставайтесь незамеченным, используйте собственную смекалку и раскройте жуткую тайну! \n\n\n\u2028\u2028\u2028\u2028Особенности:\n\n\nПроработанная система камеры от первого лица, позволяющая вам свободно передвигаться и осматриваться без малейших задержек!\u2028\u2028\n\nПоиск и использование полезных предметов. Находите фонарик, отмычки, ключи, бензиновые канистры и прочее – все это очень пригодится вам в соседском доме! \n\n\u2028\u2028Постоянно смотрите в оба – сосед может подстеречь вас где угодно! \n\nВ критической ситуации вы можете попытаться сбежать и укрыться в собственном доме – туда сосед не сможет пробраться! \n\n\u2028Ваша цель – это подвал соседского дома. Именно там кроется ключ разгадке всех страшных тайн! \u2028\u2028\n\nПотрясающий саундтрек, зловещие мелодии которого превосходно передают атмосферу мистического триллера!\u2028\u2028\u2028\u2028\u2028\n\nСумеете ли вы докопаться до истины, или же станете очередной жертвой зловещего соседа?", "bundleId":"com.neighbors.darkriddle", "userRatingCount":7396},
