//"description":"Развивающая игра для малышей «Три Кота Пикник» - собери продукты, накорми котиков и пройди все обучающие мини-игры!\n\nМиу миу миу! Коржик, Карамелька и Компот приглашают всех друзей на пикник! А ты готов присоединиться? Пусть родители отдохнут, а мы с тобой отправимся загород!\n\nВЫБИРАЙ ПРОДУКТЫ!\nМама-кошка знает, чем накормить домочадцев, помоги ей собрать корзинку с продуктами. Найди все продукты, показанные в подсказках. \nПРИГЛАШАЙ ДРУЗЕЙ!\nВсе малыши знают персонажей мультика «Три Кота». А кого ты позовешь с собой на пикник?\nОТПРАВЛЯЙСЯ В ДОРОГУ!\nНа дороге по пути в лес могут возникнуть препятствия. Помоги всем благополучно добраться до места для пикника. \n\nТебя ждут самые интересные мини-игры с котиками!\n- Игра «ловить рыбу» - попробуй поймать самую большую рыбку!\n- Игра «собирать грибы» - сыграй в съедобное – несъедобное»\n- Игра «собирать ягоды» - собери правильные ягодки в корзинку и не забудь , тут важна сортировка!\n- Игра «пикник» - разведи костер, приготовь еду и накорми всех котиков, используя подсказки!\n- Игра «ловить бабочек» - бери сачок и на охоту!\n- Игра «сбор шишек» - собирай в корзинку шишки!\n- Игра «палатка» - поставь палатку вместе с котятами!\n\nМы создаем лучшие развивающие игры для малышей. Если вы любите мультики, такие как «Три Кота», «Кукутики», «Фиксики», обязательно попробуйте все наши игры! \n\nМини-игры, головоломки для детей, раннеры, мультики и веселые песенки - с нами всегда весело!\n\nОформляя подписку, вы соглашаетесь на \"Автопродление\". \"Автопродление\" подписки происходит автоматически, если его не отключить минимум за 24 часа до окончания текущей подписки. Стоимость подписки при \"Автопродлении\" не меняется и будет равна стоимости подписки при первой покупке. Вы можете отключить \"Автопродление\" в меню \"Настройки\" вашего устройства. Оплата будет снята с учетной записи iTunes при подтверждении покупки. Действующая редакция пользовательского соглашения доступна по адресу в глобальной сети Интернет:  https://devgamekids.com/terms-of-use.html\n\nСвяжитесь с нами: support@devgameou.com\nНаш сайт: https://devgameou.com/", "bundleId":"com.devgame.catspicnic", "userRatingCount":25708},
