//"description":"HelloChinese это приложение для Весёлого, Удобного и Эффективного изучения Китайского языка!\nСозданный специально для начинающих, HelloChinese поможет вам максимально быстро достичь разговорного уровня. С HelloChinese вы сможете с абсолютного нуля поднять свой китайский до уровня нормального общения на основные темы! HelloChinese уже завоевал сердца многих пользователей и стал лучшим приложением для изучения китайского языка среди русскоговорящей аудитории, так как был создан профессионалами и преподавателями из России. Распознавание китайской речи, рукописный ввод иероглифов и другие интересные функции позволят вам изучить китайский со всех сторон в весёлой, игровой форме. \nВы и подумать не могли, что учить иностранный язык так просто!\n\nОсобенности:\n◉ Учите китайский в игровой форме: вам никогда не будет скучно!\n◉ Имеется курс Пиньинь для начинающих, который построен просто, логично и удобно\n◉ Более 1000 видео на чистом китайском от носителей языка - все от настоящих китайцев!\n◉ Функция распознавания речи поможет вам поставить идеальное произношение\n◉ Рукописный ввод иероглифов – самый быстрый способ выучить их написание\n◉Огромный словарный запас, множество иероглифов и грамматических моментов, которые полностью покрывают содержание HSK3.\n◉Всесторонняя подготовка: иероглифика, грамматика, произношение и аудирование\n◉ Поддерживается и традиционное, и упрощённое написание иероглифов\n◉ Каждый урок озвучен носителями языка – образцовый китайский прямо у вас в телефоне\n◉ Отображение китайского в иероглифах или Пиньинем – по вашему выбору\n◉ Возможность использования офлайн. Скачайте все уроки и занимайтесь, даже когда у вас нет доступа к интернету\n◉ Китайский словарь с мультимедиа карточками - учитесь читать, писать и не только\n◉ Следите за своим прогрессом с разных устройств и гаджетов\n\nСкачивайте HelloChinese прямо сейчас и начинайте учить китайский в любом удобном месте и в любое удобное время!\n\nПриложение предлагает платную подписку HelloChinese Премиум, которая в дополнение к бесплатному обучению дает тебе возможность получить доступ к дополнительным игровым функциям и режиму оффлайн.\n\nHelloChinese Премиум предлагает:\nМесячную подписку за 6.99 $\nПодписку на 3 месяца за 12.99 $\nГодовую подписку за 39.99 $\n\nПодписка возобновляется, если функция автоматического обновления не выключена в настройках iTunes по крайней мере за 24 часа до истечения твоего платежа.\n\nFacebook:  https://www.facebook.com/HelloChineseApp/\nКонфиденциальность: http://www.hellochinese.cc/privacy.html\nУсловия пользования: http://www.hellochinese.cc/terms.html", "bundleId":"com.hellochinese.main", "userRatingCount":3820},
