//"description":"Познакомьтесь с Bubbu, вашим новым виртуальным питомцем. Это милый, очаровательный и чувствительный котик, который обожает есть вкусную еду, делать селфи, навещать друзей и танцевать. Веселитесь у него дома и откройте все тайны жизни своего питомца. Он обязательно удивит вас! Исследуйте яркий мир Bubbu с помощью самых разных увлекательных приключений!\n\n• Bubbu только и ждет, чтобы его покормили, одели, приласкали и помыли. Этот милый котик нуждается в каждодневной заботе и любви, так что хорошенько заботьтесь о нем с утра до вечера. Одним словом, делайте все, чтобы котик был счастлив, всегда улыбался и не скучал, не был голодным, сонным или больным.\n\n• Отведите Bubbu в модный салон и нарядите его по последней моде. И не забудьте сделать для своего питомца домик мечты. Меняйте интерьер и обставляйте домик потрясающей мебелью, чтобы там всегда было красиво, тепло и уютно.\n\n• Более 30 веселых мини-игр обеспечат вас едой или монетами для покупки вещей для вашего виртуального кота. Например, можно сыграть в Catcher, Cat Connect, Find the Cat, 2048, Paint the Cat, Jump, Pop Balloons, Cheese Builder, Fish Ninja, Cat Sings, Nightmare, Jumping Cat, Diver, Stick Ninja, и т.д. \n\n• Крутите каждый день колесо удачи, выполняйте миссии дня и заходите к друзьям, чтобы получить награду. \n\n• Там, где живет Bubbu, скучать не придется. Превратите дом Bubbu в чудесную кошачью виллу. Вы можете выращивать овощи и фрукты в саду и каждый день доить корову как настоящий фермер. Прокачайте свою классную машину и приготовьтесь к крутой поездке. Прогуляйтесь до побережья и займитесь рыбалкой или дайвингом. Вы можете поехать в город или даже отправиться на ракете в космос, чтобы защитить планету от инопланетного вторжения. Играйте в футбол и баскетбол, прогуливайтесь вдоль прибрежных скал или залезайте на дерево. Попробуйте сменить день на ночь и наслаждайтесь звуками матушки-природы.\n\nЕсли вы хотели завести своего кота, то эта игра отлично вам подойдет. Так чего же вы ждете? Возьмите Bubbu к себе и сделайте его самым счастливым виртуальным котом в мире!\n\nЭта игра является бесплатной, но некоторые внутриигровые предметы и особенности, в том числе те, которые упомянуты в описании игры, могут потребовать оплаты в форме покупки в приложении за реальные деньги. Пожалуйста, ознакомьтесь с настройками своего устройства, в которых имеются более подробные параметры покупок в приложении.\nИгра содержит рекламу товаров Bubadu или сторонних продуктов, которая будет перенаправлять пользователей на наш/сторонний сайт или приложение.\n\nПолитика конфиденциальности: https://bubadu.com/privacy-policy.shtml\nУсловия: https://bubadu.com/tos.shtml", "bundleId":"com.bubadu.bubbu", "userRatingCount":4636},
