//"description":"Монахиня начинает сатанинский ритуал, и вы являетесь его частью.\nОставь школу, пока не стало слишком поздно.\n\nОсобенности:\n\nМонахиня слышит все. Будьте осторожны, чтобы не привлекать его внимания или шуметь, чтобы привлечь его.\nСкрыть, чтобы остаться незамеченным.\nОткройте для себя способ оставить школьные головоломки\nБольшая школа для изучения.\n\nЕсли вы хотите провести страшное время, сыграйте «Монахиня» и попытайтесь убежать из школы демонов. Страхи застрахованы.\n\nРекомендация: Играйте с наушниками, чтобы улучшить игровой процесс.\n\nЕсли вы недостаточно испугались, не стесняйтесь присылать нам письмо с вашей жалобой, и мы исправим его.\n\nВ будущих обновлениях мы добавим новый контент. И мы полностью открыты для ваших предложений по улучшению игры в максимально возможной степени.\n\n\nЭта игра содержит рекламные объявления.", "bundleId":"com.keplerians.thenun", "userRatingCount":6528},
