//"description":"В окрестности прибыл продавец мороженого! Он похитил твоего друга и соседа Майка, и ты всё это видел. \n\nОн заморозил твоего лучшего друга какой-то силой, и ты должен узнать, где он её берёт. Что, если за этой историей стоят ещё такие же дети, как он? \n\nЭтого ужасного продавца мороженого зовут Род, и он, кажется, очень дружелюбен с маленькими детьми, но у него есть злой план, который тебе придётся раскрыть. Всё, что ты знаешь, это то, что он забрал Чарли в свой фургон с мороженым. \n\nТвоя миссия будет заключаться в том, чтобы спрятаться внутри его фургона и разгадать тайну злодея. Для этого тебе предстоит путешествовать по разным локациям и решать необходимые головоломки, чтобы спасти замёрзшего друга. \n\nЧто ты можешь сделать в этой игре? \n\n- Злой Род будет слышать все твои передвижения, но ты можешь спрятаться и обмануть его, чтобы он не заметил тебя. \n- Переключайся между локациями с помощью фургона с мороженым, и открывай для себя все его секреты. \n- Решай головоломки, чтобы спасти своего соседа из лап ужасного врага. \n- Играй на призрачном, нормальном и сложном режимах! Все ли из них ты сможешь завершить? \n- Наслаждайся игрой ужасов без кровавых сцен, подходящих для любой аудитории! \n\nЕсли ты хочешь насладиться головоломками, ужасом и весельем, играй в «Ice Scream: Horror Neighboor». Восхищение и крики гарантированы. \n\n Для лучшего эффекта рекомендуется играть в наушниках. \n\nКаждое обновление принесёт новый контент, исправления и улучшения на основе твоих комментариев. \n\nЭта игра содержит рекламу.", "bundleId":"com.keplerians.icescream3", "userRatingCount":1721},
