//"description":"**Лучшие приложения года** – Apple.\n\nУмный помощник родителя. Храните воспоминания первых лет вашего малыша в интерактивном альбоме вместе с семьей! Надежно и приватно.\n\nИНТЕРАКТИВНАЯ ИСТОРИЯ ВАШЕГО МАЛЫША\nИнтерактивный детский альбом. Храните фото, видео, аудио, текстовые записи в оригинальном качестве. Пригласите родственников и добавляйте воспоминания вместе. Весь контент доступен только семье.\n\nКЛЮЧЕВЫЕ МОМЕНТЫ\nНе пропустите ни одного важного момента: первое слово, первый шаг, первый друг и многие другие – просто выбирайте их при создании событий.\n\nСтикеры. Более 500 потрясающих стикеров для ваших фото.\n\nПечатные альбомы. Получите потрясающую печатную историю на основе событий малыша в один тап.\n\nВидео истории. Получите потрясающий ролик из ваших событий в один тап.\n\nИзмерения. Фиксируйте вес и рост малыша.\n\nСООБЩЕСТВО\nДелитесь вашими историями. Читайте истории других родителей. Новый контент от нашей редакции каждый день.\n\nМАРКЕТ\nПокупайте лучшие товары для малыша в самом персонализированном маркетплейсе.\n\nПОБЛИЗОСТИ\nНаходите лучшие активности и классы для малыша в вашем городе.\n\nМы всегда рады вашим отзывам: hello@babyalbum.com", "bundleId":"com.hell-o-baby.HelloBaby", "userRatingCount":300},
