//"description":"Budge Studios™ представляет игру \"Завтрак Hello Kitty®\"! Присоединяйся к Hello Kitty в школьной столовой и выбирай, какой вариант изысканного завтрака приготовить. Если приготовить рецепт именно так, как просит Hello Kitty, она подарит премилые награды, которыми можно украсить коробку для завтрака и сделать ее совершенно особенной!\n\nФУНКЦИИ\n• Создай и измени по своему вкусу 4 уникальных рецепта для завтрака!\n• Выполни задания, чтобы приготовить такой завтрак, как просит Hello Kitty!\n• Используй кухонную утварь Hello Kitty и украшения, чтобы сделать еду супервкусной!\n• Неограниченное число вариантов украшения коробки для завтрака!\n• Получай премилые награды, чтобы сделать коробки для завтрака совершенно особенными!\n• Съешь приготовленный завтрак вместе с Hello Kitty в школьной столовой!\n\nРЕЦЕПТЫ\n• Премилые кексы!\n• Бутерброды к чаю!\n• Вкусный суп!\n• Шашлычки Hello Kitty!\n\nНАГРАДЫ\n• Коробки для завтрака замечательной формы!\n• Классные наклейки!\n• Множество цветов для рисования!\n• Милые варианты фона для коробок!\n\nКОНФИДЕНЦИАЛЬНОСТЬ И РЕКЛАМА\n Budge Studios серьезно относится к конфиденциальности детских данных и гарантирует соблюдение всех необходимых законов при использовании приложений. Данное приложение получило печать качества «ESRB Privacy Certified Kids’ Privacy Seal» агентства ESRB (Entertainment Software Rating Board). Более подробную информацию вы можете получить, ознакомившись с нашей Политикой конфиденциальности по ссылке https://budgestudios.com/en/legal/privacy-policy/ или связавшись с лицом, ответственным за защиту данных, по адресу privacy@budgestudios.ca\n\nПеред загрузкой приложения просим обратить внимание, что вы можете играть совершенно бесплатно, но некоторые настройки будут доступны только через покупки в приложении.Покупки в приложении совершаются с помощью реальных денежных средств, которые будут сниматься со счета вашей учетной записи.Отключить или настроить возможность совершать покупки в приложении можно в настройках вашего устройства.В приложении может содержаться контекстная реклама (включая рекламу, за просмотр которой можно получить награды) от Budge Studios о других публикуемых нами приложениях, а также реклама от наших партнеров и сторонних лиц.Budge Studios не допускает в приложении рекламы, содержащей поведенческий таргетинг и ретаргетинг.Приложение может также содержать ссылки на публикации в социальных сетях, которые доступны только в соответствии с настройками родительского контроля.\n\nВнимание! Приложение дает пользователю возможность делать и/или создавать фотографии внутри приложения, а затем сохранять их на устройство. Другие пользователи приложения не видят этих фотографий. Budge Studios не предоставляет иным компаниям доступа к этим фотографиям.\n\nДля запуска этого приложения может понадобиться подключение к сети. \n\nУСЛОВИЯ ИСПОЛЬЗОВАНИЯ / ЛИЦЕНЗИОННОЕ СОГЛАШЕНИЕ КОНЕЧНОГО ПОЛЬЗОВАТЕЛЯ\nИспользование этого приложения регулируется правилами лицензионного соглашения конечного пользователя, с которым можно ознакомиться, щелкнув приведенную далее ссылку:  https://budgestudios.com/en/legal-embed/eula/\n\nЕСТЬ ВОПРОСЫ? \nМы всегда рады вашим вопросам, предложениям и комментариям. Связаться с нами можно по адресу support@budgestudios.ca в режиме 24/7\n\nSANRIO®, HELLO KITTY® and associated logos are trademarks and/or registered trademarks of Sanrio Co., Ltd. used under license by Budge Studios Inc.\n\nHello Kitty® Lunchbox application © 2015 Budge Studios Inc. All artwork in application © 1976, 1979, 1988, 1993, 1996, 2015 SANRIO CO., LTD. All rights reserved.\n\nBUDGE и BUDGE STUDIOS – торговые знаки Budge Studios Inc.", "bundleId":"com.budgestudios.HelloKittyLunchBox", "userRatingCount":199},
