//"description":"Безумный мясник похитил молодую девушку и держит ее запертой в своем доме. Зайдите в его зловещий дом и спасите девушку, у вас есть только 5 часов.\n\n• Психопат может слышать ваши движения, использовать это в ваших интересах и вводить его в заблуждение.\n• Решайте головоломки, чтобы спасти девушку живьем.\n• Наслаждайтесь превосходными окружающими звуками и графикой.\n\nЕсли вы хотите реалистичный, холодный, волнующий и интенсивный опыт ужасов, играйте сейчас! Напряжение, веселье и страхи гарантированы.\n\n• Наушники рекомендуются для полного опыта.\n\nВ каждом обновлении будет доступен новый контент. Мы открыты для предложений, не сомневайтесь, отправив нам электронное письмо или высказать свое мнение в разделе отзывов.\n\n\n- Игра содержит рекламу. -", "bundleId":"com.keplerians.psychopathhunt", "userRatingCount":1647},
