//"description":"Познакомьтесь с нашим новым пёсиком - Duddu! Эта замечательная собака живёт в мире, полном веселья и приключений. Подружитесь со своим новым виртуальным питомцем, узнайте, как живёт Duddu. \n\n• Поскольку теперь у вас есть собака, вы обязаны её кормить, укладывать спать, развлекать её и ухаживать за ней. Заботьтесь о Duddu везде: и в его милом домике, и на прогулках.\n\n• Изучайте мир, в котором живёт Duddu, навестите всех его друзей. Отправьтесь с ним на солнечный остров поваляться в гамаке под кокосовыми пальмами. Оснастите свой собственный пиратский корабль. Учите Duddu интересным трюкам в школе для собак.  Танцуйте с ним в клубе, занимайтесь в спортзале, рисуйте картины и наброски в художественной галерее, играйте на пианино и барабанах в Доме Музыки. Исследуйте мир, в котором даже солнце всходит и заходит тогда, когда вы пожелаете.  \n\n• Играйте в разнообразные мини-игры –  их больше 30 – и выигрывайте монеты и другие виртуальные вещи. Развлекайтесь от души – играйте в Bubble Shooter (стрельба шариками), Solitaire (Пасьянс), Archer (Лучник), Pirate Battle (Пиратская битва), Brick Breaker (Крушитель кирпичей), Block Puzzle (Головоломка из блоков), Treasure Island (Остров сокровищ), Moto Racer (Мотогонщик), Fruit Connect (Соедини фрукты), Space Explorer (Исследователь космоса), Hen Farm (Птицеферма), а также различные кулинарные игры и многое другое. Покупайте в игровом магазине мебель, еду и одежду; оснащайте свой пиратский корабль и украшайте дом. \n\n• Выполняя ежедневные задания, вы много узнаете о привычках своего пёсика и получите дополнительные награды. Каждый день проверяйте почту, чтобы не пропустить подарок-сюрприз от своего друга.   \n\nЭта игра будет интересна всем, независимо от возраста. Забота о питомце приучает к ответственности и даёт ощущение того, что у вас есть преданный друг. Заведите себе собаку Duddu – и отправляйтесь в весёлое путешествие!\n\n\nЭта игра является бесплатной, но некоторые внутриигровые предметы и особенности, в том числе те, которые упомянуты в описании игры, могут потребовать оплаты в форме покупки в приложении за реальные деньги. Пожалуйста, ознакомьтесь с настройками своего устройства, в которых имеются более подробные параметры покупок в приложении.\nИгра содержит рекламу товаров Bubadu или сторонних продуктов, которая будет перенаправлять пользователей на наш/сторонний сайт или приложение.\n\nПолитика конфиденциальности: https://bubadu.com/privacy-policy.shtml\nУсловия: https://bubadu.com/tos.shtml", "bundleId":"com.bubadu.duddu", "userRatingCount":1424},
