ries":["Большое/значительное количество мультипликационного или фэнтезийного насилия", "Малое/умеренное количество сквернословия или грубого юмора"], "isGameCenterEnabled":false, "kind":"software", "features":["iosUniversal"], "minimumOsVersion":"11.0", "trackCensoredName":"Beat the Boss 4 - Антистресс", "languageCodesISO2A":["DA", "NL", "EN", "FR", "DE", "IT", "JA", "KO", "NB", "PT", "RU", "ZH", "ES", "SV", "ZH", "TR"], "fileSizeBytes":"734992384", "sellerUrl":"http://www.gamehive.com", "formattedPrice":"Бесплатно", "contentAdvisoryRating":"12+", "averageUserRatingForCurrentVersion":3.751770000000000049311665861750952899456024169921875, "userRatingCountForCurrentVersion":423, "averageUserRating":3.751770000000000049311665861750952899456024169921875, "trackViewUrl":"https://apps.apple.com/ru/app/beat-the-boss-4-%D0%B0%D0%BD%D1%82%D0%B8%D1%81%D1%82%D1%80%D0%B5%D1%81%D1%81/id1034018838?uo=4", "trackContentRating":"12+", "genreIds":["6014", "7001", "6016", "7014"], "trackId":1034018838, "trackName":"Beat the Boss 4 - Антистресс", "releaseDate":"2015-12-16T19:09:10Z", "sellerName":"Game Hive Corporation", "primaryGenreName":"Games", "isVppDeviceBasedLicensingEnabled":true, "currentVersionReleaseDate":"2021-04-27T14:11:13Z", "releaseNotes":"App Tracking Transparency Update and Fix for Decimal Separator Bugs", "primaryGenreId":6014, "currency":"RUB", "version":"1.7.5", "wrapperType":"software", "artistId":443272129, "artistName":"Game Hive Corp.", "genres":["Игры", "Экшен", "Развлечения", "Ролевые"], "price":0.00,
//"description":"Спустите пар в новой приключенческой игре от создателей Tap Titans 2 и Battle Bouncers! Скачано уже более 20 млн копий! \n\nЦельтесь, стреляйте и убивайте злобных боссов в новой игре франшизы Beat The Boss! \n\nНадоел суровый начальник, который над вами издевается? Хочется ему как следует врезать?\n\nИзбавьтесь от стресса, выпустите гнев на волю! Уничтожьте злобного робота, босса Джо, пока не вышло время! \n\nСоздавайте злодеев и крушите их кастомизированным оружием! Спустите на них стаю обезьян, обнажите самурайский меч или расчехлите огромную поносную пушку! \n\nЧТО ВАС ЖДЕТ В BEAT THE BOSS 4:\n▶ ИГРАЙТЕ в расслабляющий интерактивный офисный симулятор в офлайн-режиме.\n▶ СРАЖАЙТЕСЬ против двухсот с лишним уникальных злобных боссов, которые отравляют вам жизнь. \n▶ СОБИРАЙТЕ коллекцию из 190 видов разрушительного оружия и пополняйте свой арсенал. \n▶ ОТКРЫВАЙТЕ огромную карту из 10 нарисованных вручную миров и 30 интересных уровней.\n▶ СОЗДАВАЙТЕ собственное оружие от автоматов до фейерверков.\n▶ ПРИДУМЫВАЙТЕ собственных боссов — можете даже убить того, кто мешает вам в реале! \n▶ РАЗВИВАЙТЕ свои навыки уничтожения боссов, собирая золото и алмазы.\n\nО BEAT THE BOSS 4:\nБосс Джо мечтает сделать ваше рабочее место как можно отвратительнее! \nПлохо от мысли при офисе и понедельнике? Никак не можете опомниться после последнего разговора с начальником? Beat The Boss 4 — здоровый способ справиться с офисным стрессом. Гораздо приятнее йоги! \n\nОтомстите стоматологу, разбейте лицо школьному хулигану или вообще улетите в космос и убивайте там инопланетян! Путешествуя по живописному миру, вы узнаете, откуда взялся босс Джо, и почему вам нужно расправиться с ним и его злобными подручными. Собирайте золотые монеты и алмазы, чтобы купить роскошное и опасное оружие. \n\nУльи, канцтовары, даже гранаты — выбор того, что можно кинуть во врагов, бесконечен. Но не позволяйте менеджерам забиться в укрытие! Кастомизируйте свое оружие, чтобы оно стало еще опаснее и интереснее! \n\nВаш психотерапевт и коллеги очень обрадуются! Так что отомстите им всем и как следует повеселитесь.  \n\n\nСВЯЖИТЕСЬ С НАМИ!\nПрисоединяйтесь к соскучившимся коллегам в:\n▶ Facebook: facebook.com/beatthebossgame\n▶ Discord: discord.gg/gamehive\n▶ Твиттер: twitter.com/beattheboss4\n▶ Instagram: instagram.com/beatthebossgame\n▶ Блог: gamehive.com/blog\n▶ YouTube: youtube.com/user/GameHiveVideo", "bundleId":"com.gamehivecorp.beattheboss4", "userRatingCount":423},
