//"releaseNotes":"Что нового:\n\nМы вернули классическую или old school версию игры.\nВы как и раньше можете взаимодействовать с объектами: открытые шкафы, взять и выбросить предметы интерьера.\nМы откатить систему квестов.\nВернули самую первую 3D модель соседа с оригинальной версией.\nИсправили множество багов\nВернули первоначальную UI и система управления.", "primaryGenreId":6014, "currency":"RUB", "version":"1.0.4", "wrapperType":"software", "artistId":1385421493, "artistName":"PAGA GROUP LTD", "genres":["Игры", "Развлечения", "Приключения", "Головоломки"], "price":0.00,
//"description":"Это приключенческий триллер от первого лица с интерактивным окружением и интересными загадками. Решайте головоломки и раскройте тайны подозрительного соседа, который живёт напротив.\n\nВаше приключение начинается в необычном городе, где вы можете отыскать множество полезных и уникальных предметов. Вы встретите патрульного и продавца инопланетных устройств, а в процессе игры познакомитесь и с необычными существами. Каждый предмет и персонаж создают огромный увлекательный сюжет.\n\nВам нужно найти способ пробраться в дом соседа и остаться незамеченным. На пути вас ждут множество ловушек, препятствий, замков и закрытых дверей. Если вы будете внимательны и осторожны, то перехитрите всех противников, доберётесь до таинственного подвала и узнаете много интересного.\n\nЭто бесплатная игра, но некоторые предметы и способности могут быть также куплены за реальные деньги. Это может упростить прохождение и добавит новые впечатления.\n\nВозникли вопросы или предложения по игре? Напишите в службу поддержки.", "bundleId":"com.darkriddle.classic", "userRatingCount":1129},
