//"description":"(Приложение поддерживает русский язык.)\nНаберите в свою команду самых храбрых и отчаянных пиратов, чтобы господствовать на море!\n \nОКЕАН — ВАША СТИХИЯ\nПримерьте на себя роль легендарного капитана пиратов и организуйте налеты на множество враждебных пиратских кораблей, управляемых другими игроками со всего света!\n \nПРИГОТОВЬТЕСЬ К ГРАНДИОЗНЫМ ПИРАТСКИМ БИТВАМ\nСоздайте новый пиратский альянс или присоединитесь к существующему! Объединив силы, вы сможете вступить в схватку с невероятными морскими существами или другими пиратскими кораблями!\n \nПОГРУЗИТЕСЬ В ПРИКЛЮЧЕНИЯ КАПИТАНА ДЖЕКА ВОРОБЬЯ\nВас ждет целая история в сюжетном режиме. Займите место рядом с капитаном Джеком Воробьем, Уиллом Тёрнером, Капитаном Барбоссой и другими известными героями. Приключения вместе с пиратами Карибского моря ждут вас!\n \nОСОБЕННОСТИ ИГРЫ\n- СОЗДАЙТЕ флот и наберите команду бесстрашных пиратов для предстоящих битв\n- СРАЖАЙТЕСЬ с соперниками, чтобы стать самым влиятельным пиратским капитаном Карибского моря\n- ГОСПОДСТВУЙТЕ на море, вступив в альянс с другими пиратскими капитанами со всего света\n- Выполняйте ЛЕГЕНДАРНЫЕ ЗАДАНИЯ с сюжетом и персонажами из фильмов саги «Пираты Карибского моря».\n\n\nСлужба поддержки: https://joycity.oqupie.com/portals/361 \nПользовательское соглашение и политика конфиденциальности: http://policy.joycity.com/en\n\n\nЦена ежемесячной подписки составляет 2,99 доллара США.\nОхотничье вознаграждение + 10%, капитан XP Получите + 50% во время охоты при подписке.\n\nПожалуйста, обратите внимание:\n1) Оплата будет снята с вашей учетной записи iTunes при подтверждении покупки.\n2) Подписка автоматически возобновляется, если автоматическое продление не отключено по крайней мере за 24 часа до окончания текущего периода.\n3) Ваша учетная запись будет взиматься с продления в течение 24 часов до окончания текущего периода и определить стоимость продления.\n4) Подписки могут управляться пользователем, и автоматическое продление может быть отключено путем перехода к настройке учетной записи после покупки\n5) Подписка будет возобновлена в течение 24 часов с даты ежемесячного платежа. Действующие даты подписки могут меняться каждый месяц.", "bundleId":"com.joycity.potc", "userRatingCount":3561},
