//"description":"Запрыгивай и приготовься удивляться тому, что мир может тебе предложить.  Загрузи Ablo прямо сейчас и начни исседовать нашу планету так, как этого хочешь ты. \n\nЗнакомься с мeстными жителями, расширяй границы своего мира и находи друзей по всему миру. Ablo соединяет людей от Австралии до Парижа, от Северного Полюса до Марса  (совсем скоро). Смотри видео, чтобы узнать, что там, на другой стороне, и общайся с новыми друзьями по интересам. Будь собой и веселись! Ох, ты не знаешь все языки мира? Не беда! Ablo переведёт твои видео и сообщения онлайн. Общайся со своими иностранными друзьями на своём языке. \n\nОткрой свой мир. Не опоздай на свой самолёт.\n\nAblo - это приложнение онлайн сообщений и видеочатов, которое покажет тебе мир. Приложение соединяет тебя с новыми друзьями разных  национальностей и позволяет тебе разговаривать и писать сообщения на своём языке, приложение переводит твои диалоги онлайн. Изучай этот мир прямо из своего дома. \n\nAblo - мир без границ для всех\n* Путешествуй виртуально\n* Исследуй мир, общаясь с местными жителями\n* Знакомься с людьми со всего света", "bundleId":"live.ablo", "userRatingCount":2137},
