//"description":"Стань отличной домохозяйкой в этом симуляторе мамы и семейной жизни! Совмещай уборку в доме, приготовление еды и уход за малышом. Добейся того, чтобы вся твоя виртуальная семья была счастлива и довольна!\n\nДержи свой дом в чистоте и уюте. Общайся с гостями и угощай их клубничным тортом или кусочками горячей пиццы. М-м-м, вкуснятина! Заботься о малыше как образцовая мама: корми из бутылочки, меняй подгузники, приноси игрушки. Другими словами, получай удовольствие от материнства и сделай своего малыша умиротворенным и счастливым.\n\nОткрывай новые двери и комнаты в своем доме, где сможет жить твоя виртуальная семья. Изучай и открывай новые способы взаимодействовать с членами семьи.\n\nЭта игра — не простой симулятор мамы, где ты заботишься только о малыше в пустом доме. Тут ты найдешь новых персонажей, которые нуждаются в тебе и твоей поддержке! День за днем ты будешь сталкиваться с новыми активностями, обязанностями, забавными ситуациями и многим другим. Сможешь ли ты справиться с многозадачностью повседневной жизни в качестве мамы?\n\nНастраивай внешний вид малыша так, как тебе нравится. Здесь ты найдешь множество причесок и цветов, одежды для малыша и скинов, поэтому не стесняйся экспериментировать и веселиться!\n\nУчаствуй в еженедельных испытаниях с уникальными наградами, где ты проверишь свои навыки, докажешь, что достоин звания «Классная и умная мама» и сделаешь так, чтобы твоя виртуальная семья тобой гордилась. Мы будем счастливы услышать о твоих достижениях во время испытаний в симуляторе мамы!\n\nВстречай своего мужа после тяжелого рабочего дня, делай так, чтобы он чувствовал себя комфортно и был любимым. Ухаживай за своим домашним питомцем. Слушай музыку. Кушай суши или свежие фрукты. Играй. Сделай себе чашку кофе. Разозлись, когда всё выйдет из-под\n \nконтроля, сделай еще одну чашку кофе после того, как успокоишься. Будь внимательной, будь ленивой, будь счастливой мамой или дьявольской мамой. Здесь твои правила, твой виртуальный мир и твоя виртуальная семья!\n\nЧто мы предлагаем в игре “Housewife: Mother Simulator”:\n- Множество скинов и одежды для малыша;\n- Красивые украшения для мамы;\n- Малыш, который реагирует на твои действия — малыш расстраивается, когда ты делаешь что-то неправильно и малыш счастлив, когда ты крутая мама;\n- Большая виртуальная семья со своими потребностями и мечтами;\n- Симулятор материнских обязанностей и активностей — приготовь себя к настоящей семейной жизни;\n- Еженедельные испытания с уникальными наградами и многое другое.\n\nСвяжитесь с нами по support@skytecgames.com \nУсловия использования: http://www.skytecgames.com/terms-of-service.html \nПолитика конфиденциальности: http://www.skytecgames.com/privacy-policy.html", "bundleId":"com.mothersimulator", "userRatingCount":669},
