//"description":"Добро пожаловать в новую увлекательную игру! Котята не могут самостоятельно заснуть, им нужна твоя помощь. Милые котики любят помогать маме, но после уборки остается совсем мало времени чтобы поиграть. Уборка в доме занимает слишком много времени! Чтобы сделать этот процесс чуть более интересным для малышей, друзья смотрят мультики и рассказывают истории.\n\nСказки на ночь далеко не все чем занимаются Хелло Китти и ее друзья. Игрок может сортировать фотографии и рисовать. Помогите котятам подготовиться ко сну! Хелло Китти с друзьями готовы увидеть чудесные сны! Наши игры доступны в маркете абсолютно бесплатно!\n\nПожалуйста прочтите нашу политику конфиденциальности: https://policy.psvgamestudio.com/privacy_policy_appstore_clear_invest.html\nи правила пользования: https://policy.psvgamestudio.com/terms_of_use_appstore_clear_invest.html", "bundleId":"com.psvios.hellokitty.goodnight", "userRatingCount":27},
