//"description":"Твоя жизнь это фильм! Сохраняй секунду каждый день и получи ролик длиною в жизнь!\n\nСледи за тем, как меняешься и проживай лучшие моменты снова. Без рекламы и блогеров: только ты и твои друзья.\n\nСоздай историю. Запиши свой первый снэп. Продолжай каждый день: снимай путешествия, питомцев, или рост бороды. Преврати свою жизнь в фильм! Можно создать несколько историй сразу. Снимай Снэпы вместе с друзьями! Создай фильм в один тап и поделись со всеми!\n\n— Лучший сервис для твоих Снэпов\n— Безлимитное облачное хранилище: твои Снэпы в надежном месте\n— Безлимитные истории: храни разные типы событий в отдельных историях\n— Календарь: моментально загрузи свои live photos\n— Произвольная длина Снэпов: снимай больше одной секунды, если хочешь\n— Чат: обсуждай Снэпы с друзьями или оставь для себя заметку\n— Уведомления: не забывай снимать новый Снэпы\n— Приватность: никто не увидит твои Снэпы без твоего разрешения\n— Без рекламы\n\nХочешь подкинуть идею или рассказать о баге? hello@dailysnap.co\n\nМы не продаем данные пользователей, поэтому сервис работает по подписке: на месяц или на год. После активации подписки средства будут списываться с iTunes аккаунта. Подписка возобновляется автоматически, до тех пор, пока пользователь ее не отменит, как минимум за 24 часа до окончания платежного периода. Подписку можно отменить в любой момент в настройках вашего App Store аккаунта, в разделе \"Подписки\".\n\nПравила использования и Политика конфиденциальности:\ndailysnap.co/terms\ndailysnap.co/privacy", "bundleId":"com.hell-o-baby.DailySnapshot", "userRatingCount":1012},
