//"description":"Hello How Low позволяет записывать видео с ранее не существовавшими AR фильтрами - все благодаря новому LiDAR сканеру в вашем iPhone 12 Pro.\n\nОбратите внимание, что данное приложение работает только на iOS устройствах с LiDAR сканером, а именно iPhone 12 Pro, iPhone 12 Pro Max и iPad Pro 2020.\n--------------------------------\nHello How Low предоставляет подписку \"Расширенные Фильтры\". Данная подписка разблокирует доступ к основному функционалу приложения:\n• доступ к расширенным фильтрам\n• запись видео без водяного знака\nПокупая данную подписку, вы подтверждаете, что счет на оплату будет выставлен на ваш iTunes аккаунт, а подписка будет автоматически продлеваться на выбранный период времени и по тому же тарифу до тех пор, пока вы не отмените ее в настройках Tunes store (примечание: отмена должна производиться минимум за 24 часа до окончания текущей подписки). Вы сможете управлять подписками и выключать автопродление, перейдя в Профиль > Помощь > Подписки. Нажимая кнопку подписки, вы соглашаетесь с нашими Условиями* и Политикой конфиденциальности**. Подписка стоит 69₽/мес, 199 ₽/мес либо 649₽мес в зависимости от величины скидки которая может быть применена к вашему аккаунту. Окончательная стоимость подписки отображается на экране подписки перед покупкой самой подписки. Отмена активной подписки невозможна до окончания активного периода ее действия.\n\n* https://hellohowlow.com/pp.php\n** https://hellohowlow.com/terms.php", "bundleId":"com.hhl.app", "userRatingCount":100},
