//"description":"Устали от традиционной защиты крепости и бесконечной беготни? А что, если их объединить? «Кошачий отряд» – Ваш лучший выбор. Игра разработана Coconut Island, создателями Finger Balance и One Tap Hero.\nПланета котов в опасности!! Пришельцы атаковали их родину. Все взрослые на планете повержены, и только котята пытаются спастись на космическом корабле. Ваша задача – руководить их боем и прорваться сквозь вражеское окружение. Выжить – это единственный способ отстоять последнюю надежду Планеты котов!\n\nReview: \n\"Naughty Kitties is free, and even if you only play it a few times, it's worth a download.\" -- TUAW \n\n“Fire-breathing cats riding a spaceship destroying its robotic aggressors. How can you resist?\" -- PocketGamer \n\n\"Naughty Kitties is the inevitable result of a culture obsessed with paranoid invasion fantasies and pictures of cute cats.\" -- AppSpy \n\n\"A unique and seamless blend of the endless runner and tower defense genres.\" -- GAMEZEBO \n\n“Naughty Kitties may be a lite, less serious version of FTL that you can play for free.\" -- GAMEZONE \n\n\"Naughty Kitties is surprisingly challenging and addictive, and you will keep coming back for more. If you love cats, a good tower defense, or endless running game, then you will need to check out Naughty Kitties for yourself.\" -- AppAdvice \n\nЗапомните: перетаскивание – суть игрового процесса! Для определения команды просто перетащите молодого бойца и опустите его на боевую позицию на корабле. Они начнут бой автоматически сразу после введения в действие. Следите за энергией котят: они еще маленькие и не могут сражаться долго. Поэтому не забывайте вовремя заменять истощенных солдат полными сил. Вам необходимо спастись, улетев на корабле как можно дальше, и в этом Ваша конечная задача!\n\n* Оригинальный жанр: оборона крепости, смешанная с постоянным движением\n* Очень приятное оформление игры\n* Игра с помощью перетаскивания\n* 3 сценария приключений\n* Система комбо, как в играх match3\n* Многочисленные породы котят с разнотипным оружием и функциями\n* Различные виды космических кораблей, доступных для открытия\n* Улучшайте котят и корабли, для того чтобы стать сильнее\n\nСоветы:\n# 3 кота одного типа создают комбо и сильнее, чем Вы думаете.\n# Нет нужного кота в списке ожидания? Обновите его, выбросив текущий.\n# Удалите кота с космического корабля, если он Вам больше не нужен.\n\n«Кошачий отряд», динамичная защита крепости, – как раз то, что Вам нужно для разнообразия!\n\nFacebook Fan Page:\nfacebook.com/CoconutIslandStudio\nFollow us on Twitter\ntwitter.com/Coconut_Island", "bundleId":"com.cis.nk", "userRatingCount":58},
