//"description":"Заходи в новый модный бутик Hello Kitty! В этом модном приключении ей понадобится твоя помощь в приобретении последних модных новинок! Продемонстрируй свое великолепное чувство стиля и создай суперкрутой образ! Подбирай идеальные наряды в соответствии с пожеланиями клиентов! Зарабатывай лайки за пострясающие образы, чтобы создать социальную сеть на Glamgram!  \n\nКРУТО С ГОЛОВЫ ДО НОГ\n• НАРЯЖАЙ клиентов в суперкрутые наряды от Hello Kitty & Friends!\n• СОЗДАВАЙ образы по желанию клиентов бутика!\n• ПЕРЕХОДИ НА НОВЫЙ УРОВЕНЬ, чтобы добавить изюминку с помощью аксессуаров, украшений и многого другого!\n\nСОЗДАВАЙ СЛОЖНЫЕ МОДЕЛИ\n• ПОДБИРАЙ образы по специальным запросам в #hastag клиентов!\n• ВПЕЧАТЛИ клиентов суперкрутым фасоном, чтобы они разместили свой образ на Glamgram!\n• ВЫРАЗИ свое творчество в модных нарядах, чтобы заработать больше лайков на Glamgram! \n\nСДЕЛАЙ БУТИК УСПЕШНЫМ\n• ПРЕОБРАЗИ бутик Hello Kitty из скуки в КЛАСС!\n• СОЗДАЙ группу фоловеров на Glamgram с большим количеством лайков  за твои стильные образы!\n• РАСШИРЯЙ коллекцию бутика, зарабатывая лайки за новые предметы одежды!\n\nКОНФИДЕНЦИАЛЬНОСТЬ И РЕКЛАМА\nBudge Studios™ серьезно относится к конфиденциальности детских данных и гарантирует соблюдение всех необходимых законов при использовании приложений. Данное приложение получило печать качества «ESRB Privacy Certified Kids’ Privacy Seal» агентства ESRB (Entertainment Software Rating Board). Более подробную информацию вы можете получить, ознакомившись с нашей Политикой конфиденциальности по ссылке https://budgestudios.com/en/legal/privacy-policy/ или связавшись с лицом, ответственным за защиту данных, по адресу privacy@budgestudios.ca\n\nПеред загрузкой приложения просим обратить внимание, что вы можете играть совершенно бесплатно, но некоторые материалы будут доступны только через покупки в приложении. Покупки в приложении совершаются с помощью реальных денежных средств, которые будут сниматься со счета вашей учетной записи. Отключить или настроить возможность совершать покупки в приложении можно в настройках вашего устройства. В приложении может содержаться контекстная реклама (включая рекламу, за просмотр которой можно получить награды) от Budge Studios о других публикуемых нами приложениях, а также реклама от наших партнеров и сторонних лиц. Budge Studios не допускает в приложении рекламы, содержащей поведенческий таргетинг и ретаргетинг. Приложение может также содержать ссылки на публикации в социальных сетях, которые доступны только в соответствии с настройками родительского контроля.\n\nВнимание! Приложение дает пользователю возможность делать и/или создавать фотографии внутри приложения, а затем сохранять их на устройство. Другие пользователи приложения не видят этих фотографий. Budge Studios не предоставляет иным компаниям доступа к этим фотографиям.\n\nЛИЦЕНЗИОННОЕ СОГЛАШЕНИЕ С ПОЛЬЗОВАТЕЛЕМ\nВ этом приложении действуют правила, перечисленные в Лицензионном соглашении с пользователем. Ознакомиться с ними можно по указанной ниже ссылке: https://budgestudios.com/en/legal-embed/eula/\n\nО BUDGE STUDIOS\nКомпания Budge Studios основана в 2010 году. Ее миссия - развлекать и обучать детей во всем мире с помощью инноваций, творчества и веселья. Ее высококлассное портфолио мобильных приложений состоит из оригинальных и брендовых наименований. Среди них: Barbie, Thomas и его друзья, Strawberry Shortcake, Каю, Смурфики, Miss Hollywood, Hello Kitty и Crayola.\n\nЕСТЬ ВОПРОСЫ? \nСвязаться с нами можно по адресу support@budgestudios.ca в режиме 24/7\n\nSANRIO®, HELLO KITTY® and associated logos are trademarks and/or registered trademarks of Sanrio Co., Ltd. used under license by Budge Studios Inc.\n\nHello Kitty® Fashion Star application © 2019 Budge Studios Inc. All artwork in application © 1976, 1979, 1988, 1993, 1996, 2019 SANRIO CO., LTD. All rights reserved.\n\nBUDGE, BUDGE STUDIOS и BUDGE GAMES – торговые знаки Budge Studios Inc.", "bundleId":"com.budgestudios.HelloKittyFashionStar", "userRatingCount":140},
