//"releaseNotes":"A large update including new content, new features, performance improvements and bug fixes:\n\n- New Puzzles: 20% more puzzles! Try your hand at new stand-alone puzzles\n- Replay Puzzles: Access unlocked puzzles from the Main Menu to replay your favourites and solve in new ways\n- Wanderer’s Diary: Read through all the diary entries you've found to piece together the Wanderer's journey\n- ProMotion: Enjoy high frame rates on supported iPads\n- Performance: Quality and performance upgrade for iPhone 12 devices\n\nWe hope you enjoy the game and if you have any issues please do contact us to let us know.\n\nThank you so much for playing The Last Campfire!\nThe Campfire Team", "primaryGenreId":6014, "currency":"RUB", "version":"1.6", "wrapperType":"software", "artistId":573859788, "artistName":"Hello Games", "genres":["Игры", "Приключения"],
//"description":"ОБРЕТИТЕ ЦЕЛЬ\n«Последний костер» — это история о приключениях потерявшегося уголька. Оказавшись в загадочном месте, он ищет путь домой, а заодно и свое предназначение.\n \nСОВЕРШИТЕ ПУТЕШЕСТВИЕ\nПокиньте темный лес и отправьтесь вглубь окружающих вас земель, преодолевая встречающиеся на пути испытания.\n \nОТКРОЙТЕ ДЛЯ СЕБЯ МИР ВОКРУГ\nИзучайте прекрасную дикую местность, изобилующую затерянными племенами, странными существами и таинственными руинами.\n \nРАЗОЖГИТЕ ПОСЛЕДНИЙ КОСТЕР\nОбретите надежду и сберегите ее в странствиях, чтобы затем разжечь Последний костер.\n \nНАСЛАДИТЕСЬ ИГРОЙ ОТ НЕБОЛЬШОЙ СТУДИИ\nУникальная история от Hello Games и творческих личностей, придумавших LostWinds.", "bundleId":"uk.co.hellogames.thelastcompass", "userRatingCount":527},
