//"description":"ЗАХЫВАТЫВАЮЩИЕ ИГРЫ ОТ 17 ОТМЕЧЕННЫХ НАГРАДАМИ БРЕНДОВ, ВКЛЮЧАЯ\nTransformers Rescue Bots • Animal Planet • Discovery • My Little Pony • Barbie • Tomac и его друзья • Земляничка • Caillou • Hello Kitty • Crayola • Лаборатория смеха Бадж • смурфиков • Garfield • Care Bears • Miss Hollywood • Hasbro • DC Super Hero Girls\n\nМНОЖЕСТВО ИНТЕРЕСНЫХ ЗАДАНИЙ: у каждого бренда есть свой портал с самыми разнообразными заданиями\nМНОЖЕСТВО НОВЫХ МАТЕРИАЛОВ: регулярные эксклюзивные обновления, куда входят тематические земли, новые персонажи, наклейки, игры, обучающие задания и многое другое\nИНТЕРЕСНОЕ ОБУЧЕНИЕ: учитесь письму, счету и рисованию с помощью захватывающих заданий\nБЕЗОПАСНО ДЛЯ ДЕТЕЙ — безопасная среда без всплывающей рекламы и встроенных покупок для подписчиков\n\nСВЕДЕНИЯ О ПОДПИСКЕ\nСервис Budge World требует подписки. Подпишитесь на приложение, чтобы получить полный доступ ко всем материалам приложения на время действия подписки. Каждый месяц в приложение добавляется новый материал, доступный подписчикам. Часть материалов, — например, призы, наклейки и новые персонажи Budge, — открывается по мере того, как ребенок продвигается в игре.\n\n-Вы можете подписаться на месяц или на год\n-Стоимость подписки снимается с учетной записи Apple ID после подтверждения покупки\n-Пользователям может быть предложена бесплатная пробная подписка, как указано на баннерах в приложении.  Чтобы воспользоваться пробной подпиской, пользователи должны согласиться на подписку с возможностью отказаться от нее в любой момент в течение периода пробного использования.  По истечении периода пробного использования стоимость подписки будет автоматически снята, если пользователь не откажется от подписки\n-После покупки подписки пользователь теряет оставшееся время бесплатного ознакомительного периода, если таковой был\n-Пользователям может быть предложена бесплатная пробная подписка, как указано на баннерах в приложении\n**Один бесплатный пробный период для одной записи Apple ID только для новых подписчиков\n-Как и другие приложения Apple, требующие подписки, Budge World не предусматривает возможности совместного использования членами семьи\n-Подписка автоматически возобновляется, если не выключить функцию автоматического возобновления в течение 24 часов до истечения текущего периода действия подписки\n-После покупки вы сможете управлять подписками и отключать автоматическое обновление через настройки учетной записи\n-Плата за возобновление подписки будет списана со счета вашей учетной записи в течение 24 часов до окончания текущего периода подписки\n-Вы можете отменить подписку в любой момент, однако обратите внимание, что средства за оставшийся период подписки не будут возвращены\n-Если у вас возникли вопросы или вам нужна помощь, обратитесь в службу поддержки пользователей по адресу эл. почты support@budgestudios.ca\n\nКОНФИДЕНЦИАЛЬНОСТЬ И РЕКЛАМА\nДанное приложение получило печать качества «ESRB Privacy Certified Kids’ Privacy Seal» агентства ESRB. Более подробную информацию вы можете получить, ознакомившись с нашей Политикой конфиденциальности по ссылке https://budgestudios.com/en/legal/privacy-policy/ или связавшись с лицом, ответственным за защиту данных, по адресу privacy@budgestudios.ca\n\nЛИЦЕНЗИОННОЕ СОГЛАШЕНИЕ С КОНЕЧНЫМ ПОЛЬЗОВАТЕЛЕМ\nhttps://budgestudios.com/en/legal-embed/eula/\n\nПрежде чем загрузить данное приложение, обратите внимание, что это бесплатное приложение, но дополнительные материалы доступны только подписчикам. Кроме того, оно может содержать рекламу других приложений Budge Studios Inc. и наших партнеров, а также ссылки на социальные сети, по которым можно перейти, только отключив родительский контроль.\n\nBUDGE STUDIOS, BUDGE и BUDGE WORLD являются товарными знаками Budge Studios Inc. Все остальные товарные знаки, встречающиеся в данном приложении, являются собственностью соответствующих владельцев и используются Budge Studios Inc. на основании лицензии.\n\nBUDGE WORLD © Budge Studios Inc.б 2016-2020. Все права защищены.", "bundleId":"com.budgestudios.BudgeWorld", "userRatingCount":650},
