//"description":"Hello Pal provides an international social platform with instant messaging and livestreaming features. Our users come from more than 200 countries all around the world.\n\nYou can chat with people globally whenever you want, seek a relationship, and watch livestreams.\n\nAPP HIGHLIGHTS\n*****************\nGlobal Coverage\n\nWe have photos from more than 200 countries around the world, from the natural scenery of the United States to the historic buildings of Europe, to help you easily understand different cultures.\n\nInstant Friendship\n\nMet an interesting friend from another country? Follow him or her and start a conversation through chat or video calls!\n\nGet Popular\n\nGet popular on our livestream platform and receive gifts from your followers.\n\nLook for a Travel Companion\n\nEnter a travel plan or the country you want to travel to, and you can receive information and travel advice from local friends. Maybe you can find a foreign friend who wants to travel together!\n\nBreak the Language Barrier\n\nChat with people from all over the world ​​with Hello Pal. Together, we can bring the world closer together.\n\nABOUT HELLO PAL\n*****************\nHello Pal's mission is to bring the world closer together by helping eliminate one of the key obstacles to mutual understanding between people: the language barrier. By creating a platform where it is easy to instantly interact with others around the world, and giving them the tools to communicate with each other in a joyful and fun way, we hope to do our part (however small) in fostering understanding and tolerance between all citizens of the world.\n\nFor more information, visit www.HelloPal.com.\n\nHello Pal is a registered trademark or trademark of Hello Pal International Ltd in Hong Kong and other countries.\n\n\nABOUT HELLO PAL\n*****************\nHello Pal's mission is to bring the world closer together by helping eliminate one of the key obstacles to mutual understanding between people· the language barrier. By creating a platform where it is easy to instantly interact with others around the world, and giving them the tools to communicate with each other in a joyful and fun way, we hope to do our part (however small) in fostering understanding and tolerance between all citizens of the world.\n\nFor more information, visit www.HelloPal.com. Hello Pal is a registered trademark or trademark of Hello Pal International Ltd in Hong Kong and other countries.\n\nFor questions and suggestions write to support@hellopal.com.\n\n\nFOLLOW US ON:\n*****************\n • Facebook: https://www.facebook.com/hellopalchat/\n • Twitter: https://twitter.com/hellopalchat\n • Google+: https://plus.google.com/116731178310818772286\n • Instagram: http://instagram.com/hellopalchat", "bundleId":"com.hellopal.app", "userRatingCount":316},
