//"description":"~~> Познакомься со своим новым котенком - самым очаровательным пушистиком на свете!   \n~~> Наряжай котенка своей мечты и ухаживай за ней! Придумай для нее стильный образ, корми, балуй и многое другое!\nПолучай удовольствие от массы интерактивных занятий с ПУШИСТИКАМИ на Планете Котят! \nМЯУ... ничто не сравнится с любовью котенка…особенно если твой котенок самый прелестный и милый на Планете Котят! Ходят слухи, что она тоже тебя обожает! Твоей новой киске нужна любовь и внимание, чтобы помочь ей вырасти и расцвести! Ухаживай за своей новой любимицей, чтобы она стала самым счастливым котенком на Планете Котят!\n \n* Выбери котенка своей мечты из 6 милых пушистиков!\n*Корми голодного котенка кучей вкуснейших закусок!\n*Купай котеночка, пока она не засияет от чистоты!\n* Лечи больного котенка с помощью специальных ветеринарных инструментов!\n*Играй в милые веселые игры со своим любимым котенком!\n* Одевай своего котенка в стильные наряды и прелестные аксессуары!\n* Бегай наперегонки с котенком! Как быстро может бежать твоя кошечка?!  \n* Веселье в фотокабинке! Сделай фото с новым животным своей мечты!!\n* Наслаждайся великолепной интерактивной 3Д - анимацией!", "bundleId":"com.cocoplay.cocokitty", "userRatingCount":133},
