//"description":"Hello Piano - самый простой способ научиться играть на пианино и стать настоящим маэстро. Ты сам выбираешь, какие навыки освоить или улучшить, а Hello Piano составляет для тебя индивидуальный учебный план. Скачай приложение бесплатно прямо сейчас и учись играть на музыкальном инструменте в увлекательных игровых упражнениях!\n\nHello Piano научит игре на пианино и поможет освоить теорию без особого труда. Приложение будет полезно для новичков и начинающих пианистов. Твой учебный план будет состоять из ежедневных практических занятий, обучающих игр и уроков теории. Это обеспечит тренировку 4 главных навыков, необходимых каждому пианисту: чувство ритма, музыкальный слух, техника игры и сольфеджио. Используя приложение 15 минут в день, совсем скоро ты получишь желаемый результат - сможешь играть на настоящем пианино!\n\nАбсолютно новый раздел \"Персонализация\"! Этот раздел адаптирует учебный план, исходя из твоих потребностей. Сначала ты проходишь «начальный тест», а затем выбираешь свои цели. С помощью \"Персонализации\" приложение адаптирует раздел «Практика», и ты получаешь персонализированные уроки. \n\n***Функции Hello Piano***\n\nУникальные игры, направленные на тренировку определенных навыков:\n- Ритм: Bird Beat, Notes Value и Rhythm Time улучшат чувство ритма;\n- Сольфеджио: в Key Factor и Notes Names ты научишься правильно соотносить ноты, ключи и их обозначения! \n- Техника игры: в Play by Memory и Virtuoso ты будешь воспроизводить мелодию на слух, предварительно прослушав ее и распознавать ноты, нажимая на соответствующие клавиши виртуального пианино! \n- Тренировка слуха: в Melody Match и Note Pool музыканты будут играть мелодии, а тебе надо будет воспроизвести их с максимальной точностью. \n\nТеория\nМодуль содержит все необходимое, чтобы научиться нотной грамоте, знать название и длину нот, разбираться в аппликатуре, долях и музыкальных размерах. Тренировать теорию в игровых упражнениях легко и весело!\n\nСтатистика\nНаблюдай, как совершенствуются твои навыки игры в ежедневной статистике. Учись играя и зарабатывай новые интересные достижения.\n\nПрактика \nПолучай задания каждый день, выполняй их и переходи на следующий уровень!\n\nОтправляйся в захватывающее музыкальное приключение с Hello Piano!\n\nПолитика конфиденциальности: https://gismart.com/privacy-policy/\nПравила пользования: https://gismart.com/terms-of-service/\n\nПриложение содержит следующие опции подписки:\n\n- Недельная подписка с 3-х дневным бесплатным пробным периодом и недельная подписка без пробного периода.\n- Денежные средства за подписку будут списаны со счета iTunes аккаунта пользователя после подтверждения покупки.\n- Подписка будет автоматически продлена, если автопродление не отключено не позднее, чем за 24 часа до окончания текущей подписки.\n- Бесплатная пробная подписка обновляется автоматически, если она не отменена за 24 часа до обновления.\n- Настройки подписок могут быть изменены пользователем и автообновления могут быть отключены в Настройках Аккаунта после совершения покупки.\n- Цена подписки эквивалентна соответствующей цене в другой валюте, определенной в ценовой матрице «Apple's App Store Matrix».\n- Неиспользованное время бесплатной подписки (если предложено) будет утрачено, если вы приобретете премиум подписку в течение пробного бесплатного периода.\n- Вы можете оформить подписку на безлимитный доступ к Премиум функциям:\n* Персонализированные уроки\n* Все игры\n* Без рекламы\n\n*Цена считается на основе ценовой матрицы «Apple's App Store Matrix».", "bundleId":"piano.edu.gismart", "userRatingCount":296},
