//"description":".*:+Оригинальная Кафе - История с участием  Hello Kitty & Друзей +:*. \nПрими участие в замечательном кафе-приключении вместе с  Hello Kitty и создай лучшее кафе в городе. Выполняй задания вместе с Cinnamoroll, Pompompurin, My Melody и другими культовыми персонажами Sanrio в очаровательной истории!\n\n.*:+Создавай Уникальные Дизайны Своего Кафе +:*.\n Ты встретишь любимых персонажей Sanrio в удивительных кат-сценах и завораживающие кафе тематики Sanrio, смоделированные под каждого из персонажей.\n\n .*:+Открывай Очаровательных Персонажей Sanrio +:*.\nНанимай на работу более 30 игровых Персонажей Sanrio, каждого со своим уникальным магическим мастерством и особым снаряжением! \n\n.*:+40+ Мероприятий и Заданий +:*. \nСтань частью грандиозного шествия к пьедесталу лучших из лучших, ведь тебе брошен кафе-вызов, из более чем 40 заданий! \n\n.*:+Будь на Связи & Играй с Друзьями +:*. \nДобавь друга через Facebookили с помощью кода для друга и не забудь похвастать своим персонажем!", "bundleId":"com.sdeu.itunes.hellokittydreamcafe", "userRatingCount":57},
