//"description":"Присоединяйся к друзьям Hello Kitty и Sanrio в лучшей игре! БЕСПЛАТНО!\n\nHello Kitty с друзьями собираются устроить музыкальную вечеринку, дарить всем радость и любовь! Помоги им организовать масштабную, удивительную вечеринку в самой восхитительной музыкальной игре! Но это не просто игра-кликер, ведь если ты будешь двигаться в такт и исполнишь свой ТАНЕЦ СЧАСТЬЯ, ты получишь еще больше положительных эмоций! Сыграй песню, затем нажми и танцуй в такт! \n\nОСВОБОДИ СВОИ ЛЮБИМЫЕ ПЕРСОНАЖИ SANRIO!\nИграй свои любимые песни, чтобы освободить любимцев Sanrio, таких как Hello Kitty, My Melody, Cinnamoroll, Pompompurin среди многих других!  \n\nСТАНЬ ХОЗЯИНОМ УДИВИТЕЛЬНОЙ ВЕЧЕРИНКИ!\nСтрой музыкальные здания, чтобы привлечь гостей!\n\nИГРАЙ СВОИ СОБСТВЕННЫЕ ЛЮБИМЫЕ ПЕСНИ!\nЗагружай свои собственные песни в приложение и жми! Приложение использует  технологию распознавателя аккордов Jamn Player для определения аккордов и тональности ваших песен!  \n\nИСПОЛНИ ТАНЕЦ СЧАСТЬЯ И ПОЛУЧИ  БОЛЬШЕ ЭМОЦИЙ!\nРитмично двигай телом! Это приложение распознает движения твоего тела, а потому не забывай танцевать, пока жмешь на экран, чтобы получить еще больше удовольствия!\n\nЛЕГКО ИГРАТЬ, НЕПРИНУЖДЕННАЯ ИГРА КЛИКЕР\nЖми до упаду! Или не жми совсем, и все же получай море эмоций! Нет ничего проще.\n\nИГРАЙ НА МНОЖЕСТВЕ УСТРОЙСТВ ЧЕРЕЗ СОХРАНЕНИЕ В ОБЛАКЕ!\nСохраняй игру в любой момент, играй, когда захочешь, делай резервную копию данных своей игры!\n \nПОСЫЛАЙ МИЛЫЕ СООБЩЕНИЯ С ПОМОЩЬЮ НАШИХ iMESSAGE® СТИКЕРОВ!\nЧто может быть лучше, чем говорить обо всем с помощью стикеров kawaii Sanrio и Hello Kitty?! \n\nБудь в курсе всех обновлений!\nПоставь свой лайк в Facebook: https://www.facebook.com/sanriotownpage/\n\n**Пожалуйста, обратите внимание, приложение предлагает оплачиваемый контент.**", "bundleId":"com.sd.itunes.hellokittymusicparty", "userRatingCount":181},
